import React  from "react";
import PosteNote from "./PosteNote";
import PosteVote from "./PosteVote";

function PosteList({posts,setposts})  {
   
    
    return <>
        {posts.map(function(post) {

               if(post.Type === 'note') return <PosteNote  post={post}/> 
               return null;

               if(post.Type === 'vote') return <PosteVote  post={post}/> 
               return null;
             
            
checkSwitch=(param)=>{
 
    switch(param) {
 
      case '1':
        this.ONE();
        break;
      
      case '2':
        this.TWO();
        break;
 
      case '3':
        this.THREE();
        break;
 
      case '4':
        this.FOUR();
        break;
 
      default:
        Alert.alert("NUMBER NOT FOUND");
    
      }
 
  }
        }
        )}
       
    </>
}

export default PosteList
